import React from "react";
import { useParams } from "react-router-dom";
import { data } from "../data/data";

export const NewPage = () => {
  const { id } = useParams();
  return (
    <div>{data.map((item) => item.id == id && <p>{item.description}</p>)}</div>
  );
};
